import "./App.css";

function App() {
  let data = [
    {
      id: 1,
      first_name: "Kylen",
      last_name: "Greenroa",
      email: "kgreenroa0@weibo.com",
    },
    {
      id: 2,
      first_name: "Katina",
      last_name: "Pinare",
      email: "kpinare1@myspace.com",
    },
    {
      id: 3,
      first_name: "Sallyann",
      last_name: "Spellsworth",
      email: "sspellsworth2@last.fm",
    },
    {
      id: 4,
      first_name: "Winna",
      last_name: "Crutch",
      email: "wcrutch3@parallels.com",
    },
    {
      id: 5,
      first_name: "Ethelind",
      last_name: "Labrum",
      email: "elabrum4@statcounter.com",
    },
  ];
  return (
    <div className="App">
      {data.map((item, index) => {
        return (
          <p key={index}>
            {item.map((content, index) => {
              return (
                <ul>
                  <li key={index}>{content.id}</li>
                  <li key={index}>{content.first_name}</li>
                  <li key={index}>{content.last_name}</li>
                  <li key={index}>{content.email}</li>
                </ul>
              );
            })}
          </p>
        );
      })}
    </div>
  );
}

export default App;
